// Export functions for compatibility
export const getMitsubishiProductsByCategory = (category: string): Product[] => {
  if (category === 'All Products') return mitsubishiScrapedProducts;
  return mitsubishiScrapedProducts.filter(p => p.category === category);
};

export default mitsubishiScrapedProducts;
